                //                CertificateQRCodeDto obj = new CertificateQRCodeDto();
                //                obj.AuditProjectId = input;
                //                obj.BusinessEntityId = businessids;
                //                result.Add(obj);

                //            }

                //        }
                //    }
                //}

                var auditDecisionObj = await _auditDecFormRepository.GetAll().Where(x => x.AuditProjectId == input).FirstOrDefaultAsync();
                if (auditDecisionObj != null)
                {
                    var splitArray = auditDecisionObj.BusinessEntityNames.Split(',');
                    for (int i = 0; i < splitArray.Length - 1; i++)
                    {
                        var businessids = int.Parse(splitArray[i].Split(':')[0]);
                        businessEntityIds.Add(businessids);
                    }

                    var LicenseNos = await _businessEntityRepository.GetAll().Where(x => businessEntityIds.Contains(x.Id))
                        .Select(x => x.LicenseNumber).ToListAsync();

                    var certificateList = await _certificateImportRepository.GetAll()
                        .Where(x => auditDecisionObj.ExpireDate <= x.ExpireDate && auditDecisionObj.DecisionDate <= x.IssueDate
                        && LicenseNos.Contains(x.LicenseNumber)).ToListAsync();

                    if (certificateList.Count() > 0)
                    {
                        certificateList.ForEach(y =>
                        {
                            var businessEntityObj = _businessEntityRepository.FirstOrDefault(x => x.LicenseNumber == y.LicenseNumber);

                            CertificateQRCodeDto obj = new CertificateQRCodeDto();
                            obj.TenantId = AbpSession.TenantId;
                            obj.AuditProjectId = auditDecisionObj.AuditProjectId;
                            obj.IsCertificateGenerate = true;
                            obj.QRCode = y.Qrcode;
                            obj.BusinessEntityId = businessEntityObj.Id;
                            result.Add(obj);
                        });
                    }
                    else
                    {
                        if (splitArray.Length > 1)
                        {
                            for (int i = 0; i < businessEntityIds.Count(); i++)
                            {
                                CertificateQRCodeDto obj = new CertificateQRCodeDto();
                                obj.AuditProjectId = input;
                                obj.BusinessEntityId = businessEntityIds[i];
                                result.Add(obj);
                            }
                        }
                    }
                }

                return result;
            }
            catch (Exception ex)
            {
                throw new Exception(ex.Message);
            }
        }

        public async Task<CertificateQRCodeDto> GetCertificateQRCodeById(int input)
        {
            try
            {
                var Obj = await _certificateQRCodeRepository.GetAll().FirstOrDefaultAsync(x => x.AuditProjectId == input);
                var result = await _certificateQRCodeRepository.GetAll().FirstOrDefaultAsync(x => x.Id == Obj.Id);
                return ObjectMapper.Map<CertificateQRCodeDto>(result);
            }
            catch (Exception ex)
            {
                throw new Exception(ex.Message);
            }
        }

        public async Task<string> GenerateQRCOde(int businessEntityId)
        {
            var input = " License Number:MF2257;Name:Bareen International Hospital;Issue Date: 01 July 2021;Expiry Date: 30 June 2024;";
            var result = "data:image/png;base64,";
            //  var businessEntityObj = _busines
            using (MemoryStream ms = new MemoryStream())
            {
                QRCodeGenerator qRCodeGenerator = new QRCodeGenerator();
                QRCodeData qRCodeData = qRCodeGenerator.CreateQrCode(input, QRCodeGenerator.ECCLevel.Q);
                QRCode qrcode = new QRCode(qRCodeData);
                using (System.Drawing.Bitmap obitmap = qrcode.GetGraphic(20))
                {
                    obitmap.Save(ms, ImageFormat.Png);
                    result = result + "" + Convert.ToBase64String(ms.ToArray());
                }
            }

            return result;
        }

